import React from "react";
import ReactDOM from "react-dom";


import {add,sub,mult,div} from "./Calcu";


ReactDOM.render(
    <>
    <ul>
        <li>Sum Of 2 Nos {add(30,3)}</li>
        <li>Substraction {sub(40,9)}</li>
        <li>Multiplication {mult(82,2)}</li>
        <li>Division {div(33,3)}</li>
    </ul>
    </>,
    document.getElementById("root")
);
